import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

import Login from "./components/component-login";
import Register from "./components/component-register-user";
import resetPassword from "./components/component-reset-password";
import changePassword from "./components/component-change-password";


function App() {
  return (
    <Router>
      <div>
        <h2>Add you code in this div</h2>

        <Route path="/" exact component={Login} />
        <Route path="/register" component={Register} />
        <Route path="/chagepassword" component={changePassword} />
        <Route path="/resetpassword" component={resetPassword} />
      </div>
    </Router>
  );
}

export default App;
